import { Injectable } from '@angular/core';
import { CustomerInvoices } from '../shared/customer-invoices.model'
@Injectable({
  providedIn: 'root'
})
export class CustomerInvoicesService {

  private _selectedCustomerInvoices: CustomerInvoices;
  public get selectedCustomerInvoices(): CustomerInvoices {
    return this._selectedCustomerInvoices;
  }
  public set selectedCustomerInvoices(value: CustomerInvoices) {
    this._selectedCustomerInvoices = value;
  }
  constructor() { }
}
